131851.jpg','壶口瀑布',11,36),(125,0,'2014-08-17 00:15:06','\0','洪洞大槐树，又称古大槐树，山西大槐树，位于中国山西省洪洞县城西北二公里的贾村西侧的大槐树公园内，是明代的一处移民基地。至今在河北、河南、山东、东北等地区仍流传着一句民谣：“问我老家在何处，山西洪洞大槐树。祖先故居叫什么，大槐树下老鹳窝”。',NULL,214281,'jpg','山西省临汾市洪洞县大槐树镇明代移民遗址',0,36.269034,111.676605,'\0','\0',NULL,'1362678_1301131635.jpg','洪洞大槐树',11,NULL),(126,0,'2014-08-17 00:19:01','\0',NULL,NULL,868257,'jpg','浙江省嘉兴市嘉善县西塘镇嘉善县西塘古镇景区',0,30.941323,120.889049,'\0','\0',NULL,'DSCN0293.jpg','浙江嘉善西塘',11,36),(127,0,'2014-08-18 14:47:13','\0','大地的“年轮”记录了历史的沧桑，这是内陆湖泊逐年干涸后留下的印记。多年之后，人类的活动唤醒了蕴藏丰富资源的大地，一条道路自左向右横穿整块区域。',NULL,945730,'jpg','青海省海西蒙古族藏族自治州',0,38.631891,93.084412,'\0','\0',NULL,'甘肃 酒泉市 阿克塞县 附近.jpg','甘肃 酒泉市 阿克塞县',4,38),(128,0,'2014-08-18 15:17:44','\0','“大耳朵”区域是典型的内陆湖泊逐年干涸后湖盆经风蚀所形成的雅丹地貌，是我国西部典型的荒漠景观。蓝色的人工水库和浅粉色的戈壁绿洲，为枯燥的黄褐色的戈壁和沙漠增添了一笔鲜活的色彩。',NULL,956233,'jpg','新疆维吾尔自治区巴音郭楞蒙古自治州若羌县罗布泊镇',0,40.128491,90.587769,'\0','\0',NULL,'新疆吐鲁番鄯善县罗布泊镇.jpg','新疆吐鲁番鄯善县罗布泊镇大耳朵地形',4,37),(129,0,'2014-08-18 15:48:28','\0','图像上方的方块是农田，此时农作物尚未返青，地块呈现灰褐色。沉积岩层经流水侵蚀切割所形成的山脉，中间如灰白色“骨骼”状的东西方向连续山丘是坚硬的岩层所残留的，而下方大片红色是由于山上的植物覆盖所致。图像正中自上而下的是山谷中的一条河流。',NULL,1451773,'jpg','新疆维吾尔自治区昌吉回族自治州玛纳斯县塔西河哈萨克民族乡',0,44.075747,86.347046,'\0','\0',NULL,'新疆 昌吉州 呼图壁县  山谷.jpg','新疆 昌吉州 呼图壁县',4,37),(130,0,'2014-08-18 16:35:36','\0','图像中间如“红叶”般的区域山体植被覆盖较好，流水侵蚀导致的沟谷特征如同“红叶”的叶脉一般。图像左下方粉红色是农作物耕作区。图像右下方白色区域是积雪覆盖。',NULL,1600223,'jpg','山西省长治市襄垣县夏店镇秦家庄',0,36.474307,112.840576,'\0','\0',NULL,'山西 长治市 附近.jpg','山西长治红叶地形',4,37),(131,0,'2014-08-18 16:44:24','\0','中部灰白色部分为在风蚀作用下形成的流沙，下部白色部分为流水与风力共同形成的湖中沙坝。',NULL,558566,'jpg','青海省海北藏族自治州海晏县',0,36.888408,100.516319,'\0','\0',NULL,'青海 海北州 青海湖畔 东北角.jpg','青海 海北州 青海湖畔 东北角',4,37),(132,0,'2014-08-18 16:50:38','\0','这是典型的黄土高原地貌，在长期流水侵蚀下地面被分割得非常破碎，形成沟壑交错其间的塬、墚、峁、川。平坦的墚顶和峁顶，一般进行农田耕作，呈现微暗的粉红色。蜿蜒迩流的洛河贯穿整个区域。',NULL,1354467,'jpg','陕西省延安市黄陵县阿党镇黄窑科',0,35.740939,109.327698,'\0','\0',NULL,'陕西延安黄陵县 洛河.jpg','陕西延安黄陵县 洛河',4,38),(133,0,'2014-08-18 16:58:31','\0','图像黄色是沙漠，图像下方是高山，山上的河流自南向北流动，在山前形成绿洲',NULL,960579,'jpg','新疆维吾尔自治区和田地区和田县英艾日克乡',0,37.26531,79.865112,'\0','\0',NULL,'新疆 和田 墨玉县.jpg','新疆 和田 墨玉县绿洲',4,37),(134,0,'2014-08-18 17:02:10','\0','排列整齐如“网格”的盐田和养殖场是海滩利用的主要形式之一。作为胜利油田所在地的东营海滩，则广泛分布着 “白点”状的油井。图像中上方的白色直线是调流坝。',NULL,796509,'jpg','山东省滨州市无棣县',0,38.150487,118.054619,'\0','\0',NULL,'山东 东营 河口区 海滩.jpg','山东 东营 河口区 海滩',4,37),(135,0,'2014-08-18 17:37:27','\0','亮红色部分与褐色部分层次分明，反映了不同类型的植被。图像中的白色线状部分是季节性河流形成的干涸沟谷。',NULL,1518881,'jpg','甘肃省庆阳市正宁县西坡乡马家沟',0,35.484156,108.48587,'\0','\0',NULL,'甘肃 庆阳市 正宁县 崇山峻岭.jpg','甘肃 庆阳市 正宁县 崇山峻岭',4,37),(136,0,'2014-08-18 17:44:58','\0','不同类型和不同年代形成的戈壁滩，层次分明。扇状洪积物特别明显，白色区域是盐碱地，“水母”须是水流形成的冲积沟。',NULL,843592,'jpg','甘肃省酒泉市敦煌市黄渠乡',0,40.979898,94.54834,'\0','\0',NULL,'甘肃 酒泉 敦煌市 附近.jpg','甘肃 酒泉 敦煌市的“水母”',4,37),(137,NULL,'2014-08-19 16:34:44','\0',NULL,NULL,98448,'jpg','新疆维吾尔自治区阿勒泰地区福海县喀拉玛盖乡',0,46.570191,88.154297,'\0','\0',NULL,'66ae49eft9292d46ad472&690.jpg','新疆阿勒泰哈吧河',3,39),(138,NULL,'2014-08-19 16:34:45','\0',NULL,NULL,95754,'jpg','甘肃省定西市临洮县漫洼乡羊圈沟村',0,35.424868,104.27124,'\0','\0',NULL,'66ae49eft9292d4ebfedc&690.jpg','甘肃定西',3,39),(139,NULL,'2014-08-19 16:34:45','\0',NULL,NULL,123685,'jpg','贵州省毕节市纳雍县猫儿谷',0,26.819169,105.065002,'\0','\0',NULL,'66ae49eft9292d56c5a2f&690.jpg','贵州六盘水',3,39),(140,NULL,'2014-08-19 16:34:45','\0',NULL,NULL,161391,'jpg','西藏自治区昌都地区八宿县吉达乡扎西孜',0,29.97516,96.675568,'\0','\0',NULL,'66ae49eft9292d3e88ff2&690.jpg','川藏公路',3,39),(141,NULL,'2014-08-19 16:34:51','\0',NULL,NULL,155202,'jpg','西藏自治区日喀则地区定日县扎西宗乡',0,28.110749,86.726074,'\0','\0',NULL,'66ae49eft9292d782f3c3&690.jpg','喜马拉雅山',3,39),(142,NULL,'2014-08-19 21:50:34','\0',NULL,NULL,2991631,'JPG',NULL,NULL,NULL,NULL,'\0','\0',NULL,'DSC02423.JPG',NULL,6,NULL),(143,NULL,'2014-08-19 21:56:19','\0',NULL,NULL,884190,'jpg',NULL,0,34.84141374999474,116.40882427472197,'\0','\0',NULL,'IMAG2170.jpg',NULL,6,NULL),(144,NULL,'2014-08-19 21:56:26','\0',NULL,NULL,1490647,'jpg',NULL,0,34.835991177956295,116.39689570218323,'\0','\0',NULL,'IMAG2233.jpg',NULL,6,NULL),(145,NULL,'2014-08-19 21:56:28','\0',NULL,NULL,1614575,'JPG',NULL,NULL,NULL,NULL,'\0','\0'